function Home() {
  return (
    <AnimatedFade>
      <div className="Home">
        <header className="header">
          <div className="container header py-4 center">
            {/* <img src={logo} className="Home-logo" alt="logo" /> */}
            <h1 className="pageTitle">Implementações de paralaxe em um aplicativo ReactJS</h1>
          </div>
        </header>

        <DemoCanvas />
      </div>
    </AnimatedFade>
  );
}

export default Home;
